body:
I added a loop calling Run with the same input, and saved the elapsed time in both milliseconds and microseconds. First call is 17ms. Subsequent calls are way less than 1ms. i.e. first call is slow, but that shouldn't be an issue as long as you re-use the InferenceSession.

<img width="172" alt="image" src="https://user-images.githubusercontent.com/979079/190032286-2e25e065-f0ef-4ba2-b73b-db6be7dc2c77.png">

```c#
            var results_millisecsc = new List<long>();
            var results_microsecs = new List<double>();
            for (int i = 0; i < 10; i++)
            {
                stopWatch.Start();
                var output = session.Run(input);
                stopWatch.Stop();
                timerClock.modelRunningTimer = stopWatch.ElapsedMilliseconds;
                results_millisecsc.Add(stopWatch.ElapsedMilliseconds);
                results_microsecs.Add((Convert.ToDouble(stopWatch.ElapsedTicks) / Stopwatch.Frequency) * 1000 * 1000);
                stopWatch.Reset();
                var mapping = output.ToList().Last().AsEnumerable<NamedOnnxValue>();
                var inferenceResult = mapping.First().AsDictionary<Int64, float>();
                pred.Slow = inferenceResult.First().Value;
                pred.Fast = inferenceResult.Last().Value;
            }
